import React, { Component } from 'react';
import {connect} from "react-redux"
import {compose} from "redux"
import "bootstrap/dist/css/bootstrap.min.css"
import queryString from "query-string"
import {withRouter} from "react-router-dom"
class Inputdata extends Component {
    constructor(props) {
        super(props);
        this.state = { 
            val :""
         }
    }
    componentDidMount = () => {
        const parsedQuery = queryString.parse(this.props.location.search);
        console.log("inputdata", parsedQuery)
        if(parsedQuery){
            var val = Object.values(parsedQuery).toString();
            console.log("val",val)
            this.setState({val})
            
        }
    }
    render() { 
        return ( 
            <div>
                <h1 style={{textTransform:"capitalize",padding:"10px"}}>
                  <small style={{color:"lightgrey"}}> RESULT <span className="fa fa-arrow-right"></span></small> {this.state.val || this.props.inputval}
                </h1>
            </div>
         );
    }
}
const mapStateToProps =(store)=>{
    return{           
       products: store.products,
       searching:store.searching,
       status:store.status,
       filteredSuggestions: store.filteredSuggestions,
       suggestions: store.suggestions,
       showSuggestions: store.showSuggestions,
       inputval: store.inputval
     }
  } 
export default compose(withRouter, connect(mapStateToProps))(Inputdata);
